import React from "react";
import Header from "./Header";
import Note from "./Note";
import Footer from "./Footer";
import notes from "../notes";
import InputArea from "./Input";

function App() {
  return (
    <>
      <Header />
      <InputArea 
        onAdd = {hand}
      />
      {notes.map((note) => (
        <Note key={note.id} title={note.title} content={note.content} />
      ))}
      <Footer />
    </>
  );
}

export default App;
